import React from "react";
import "./main.css";

export default function Main() {
  return (
    <main className="main">
      <div className="main-left">
        <div className="list-category">
          <ul></ul>
        </div>
      </div>
      <div className="main-center">
        <p>C</p>
      </div>
      <div className="main-right">
        <p>R</p>
      </div>
    </main>
  );
}
